import React from 'react';
import '../styles/Navbar.css';

class Navbar extends React.Component {
  render() {
    return (
      <div className="Navbar">
        <h2>Techbitz</h2>
        <nav>
          <a href="/">Home</a>
          <a href="/services">Services</a>
        </nav>
      </div>
    );
  }
}

export default Navbar;
